import React from 'react';

import {Button,Form,Col} from 'react-bootstrap';

function authority() {
    return(
        <div>
        <div class="col-sm-8">
        <div class="row">
  <div class="col-md-12">

    <select class="mdb-select colorful-select dropdown-primary md-form" multiple searchable="Search here..">
      <option value="" disabled selected>Choose your country</option>
      <option value="1">USA</option>
      <option value="2">Germany</option>
      <option value="3">France</option>
      <option value="4">Poland</option>
      <option value="5">Japan</option>
    </select>
    <label class="mdb-main-label">Label example</label>
    <button class="btn-save btn btn-primary btn-sm">Save</button>

  </div>
</div>
    </div>

    <div class="col-sm-8">

        <div classs="text-right">
    
            <Button variant="info" type=" save ">save</Button>{' '}

            <Button variant="danger" type=" save ">Delete</Button>{' '}
        
            <Button variant="primary" type=" save ">Remove Modify Right</Button>{' '}

            <Button variant="secondary" type=" save ">View All</Button>{' '}
            
        </div>

        <Form.Check inline label="Add Right" />  
        <Form.Check inline label="Modify Right" /> 
        <Form.Check inline label="Delete Right" />
        <Form.Check inline label="View Right" />     
  
        </div>
    </div>
   
    );
}
export default authority;
